import React from "react";
import Button from "@mui/material/Button";
import { useNavigate } from "react-router-dom";

const ButtonHeader = ({ ...props }) => {
  const navigate = useNavigate();

  const goToNewPage = (path) => {
    navigate(path);
  };

  return (
    <div {...props}>
      <Button
        onClick={() => goToNewPage("/donanim")}
        color="black"
        variant="text"
        oncl
      >
        DONANIM
      </Button>

      <Button
        onClick={() => goToNewPage("/yazilim")}
        color="black"
        variant="text"
      >
        YAZILIM
      </Button>

      <Button
        onClick={() => goToNewPage("/oyunlar")}
        color="black"
        variant="text"
      >
        OYUNLAR
      </Button>

      <Button
        onClick={() => goToNewPage("/yenilikler")}
        color="black"
        variant="text"
      >
        YENİLİKLER
      </Button>

      <Button
        onClick={() => goToNewPage("/yapay-zeka")}
        color="black"
        variant="text"
      >
        YAPAY ZEKA
      </Button>

      <Button
        onClick={() => goToNewPage("/acik-kaynak")}
        color="black"
        variant="text"
      >
        AÇIK KAYNAK
      </Button>

      <Button
        onClick={() => goToNewPage("/front-end")}
        color="black"
        variant="text"
      >
        FRONT-END
      </Button>

      <Button
        onClick={() => goToNewPage("/back-end")}
        color="black"
        variant="text"
      >
        BACK-END
      </Button>
    </div>
  );
};

export default ButtonHeader;
